import Face from '../../assets/facebook.png';
import Twitter from '../../assets'
import './style.css';

export default function Rodape(){
    return(
        <footer className="footer-escuro">
            <div>
                <img className="logo" src={Logo} alt="logo" />
            </div>
                <p className="paragrafo">Ajudamos a criar uma personalidade digital construindo sua marca no ambiente online utilizando estrat√©gias,
                ferramentas e tecnologias personalizadas.</p>
                <div className="redes">
                    <img className="img-rede" src={Face} alt="face" />
                    <img className="img-rede" src="assets/twitter.png" alt="twitter" />
                    <img className="img-rede" src="assets/linkedin.png" alt="linkedin" />
                    <img className="img-rede" src="assets/dribble.png" alt="dribble" />
                    <img className="img-rede" src="assets/behance.png" alt="behance" />
                    <img className="img-rede" src="assets/google-plus.png" alt="google" />
                </div>
                <p className="ultimo-p">Copyright 2022 nome do desenvolvedor</p>
        </footer>
    );
}
